INSERT INTO `myaac_faq` (`id`, `question`, `answer`, `ordering`, `hidden`) VALUES
(1, 'Send a parcel to a player?', 'How do i send a parcel to a player from a city?\r\n\r\n<br>It\'s simple.\r\nwith the lebel inside the parcel, open it and write the name of the player who will send and in the line below the name of the city, without special characters.', 0, 0),
(2, 'How do I climb with the rope?', '<br>The rope climbing system this version is preserved.\r\n<br>To go up, there must be no players, monsters and items stacked on top of the place the rope is supposed to use, except liquids.', 1, 0),
(3, 'How to use runes on players?', '<br>This version the battle system is preserved, to attack or heal other players requires experience with the mouse.\r\n<br>With the rune in the backpack, right click on the rune and move the mouse to the player\'s feet and press the left mouse button. <br>Battle is just for attacking runes on monsters.', 2, 0),
(4, 'How do I learn spells?', '<br>To learn spells, you must have money and a magic level above 0.<br>\r\nMust look for Npcs according to their vocation.', 3, 0),
(5, 'How do I pay house rent?', 'You must keep an amount of money above the rent in the depository of the city to which the house is attached. when you run out of money in the deposit you will be notified by letter for 7 days before the rent is due.', 4, 0),
(6, 'Do raids have specific times?', 'No, Raids are random. any time there can be an attack, so also unannounced raids.', 5, 0);
INSERT INTO `myaac_forum` (`id`, `first_post`, `last_post`, `section`, `replies`, `views`, `author_aid`, `author_guid`, `post_text`, `post_topic`, `post_smile`, `post_html`, `post_date`, `last_edit_aid`, `edit_date`, `post_ip`, `sticked`, `closed`) VALUES
(1, 1, 1689657960, 1, 0, 29, 1323211, 2, '<p style=\"text-align: center;\"><em><strong>Welcome to TibiaCore 7.4</strong></em></p>\r\n<p style=\"text-align: center;\"><img src=\"https://i.imgur.com/L3Nlvzz.png\" alt=\"\" width=\"513\" height=\"385\" /></p>\r\n<p style=\"text-align: center;\">Dear player.&nbsp;We are pleased to announce that our server will definitely be open as we prepare for the grand opening.&nbsp;Soon, you will have the opportunity to embark on an incredible journey filled with nostalgia and excitement.</p>\r\n<p style=\"text-align: center;\">At TibiaCore, we are committed to maintaining the original essence of the game, without any weapons or other customized items except items usable for donors. We understand the importance of preserving the authenticity and nostalgia that gamers cherish.</p>\r\n<p style=\"text-align: center;\">Get ready to join us on this incredible adventure! Stay tuned for the official opening announcement and be one of the first to experience the excitement of TibiaCore.</p>\r\n<p style=\"text-align: center;\">Get ready for an unforgettable journey full of excitement, camaraderie and epic battles. We can\'t wait to welcome you to our server!</p>\r\n<p style=\"text-align: center;\">Enjoy the game!</p>', 'Welcome Tibians', 0, 1, 1689657960, 0, 1696230646, '172.68.19.20', 0, 0),
(2, 2, 1697008634, 1, 0, 6, 1323211, 2, '<p style=\"text-align: left;\"><em><strong>Dear Players&nbsp;</strong></em><em>House Auctions have been implemented. Now, everyone can place bids.</em><br /><br /><em>The bids will be valid if:</em><br /><em>1. You have money in the depot of the city where the house is being auctioned.</em><br /><em>2. You do not remove your money from the depot or engage in any fraudulent activities.<br /><br /></em><em>Those who wish to place bids must have enough money to cover the bid amount and the house rent. <br />If you do not have sufficient funds, please ensure you deposit the bid amount and rent in advance. Failure to do so will result in a 7-day your account suspension from the house auction system.<br /><br />Remember, it\'s money in the deposit of the city where the house is. and in the bid+rent value, the rent is postponed for 30 days.<br /></em></p>\r\n<p><em>It is now no longer possible to buy a house using the !buyhouse command.<br /></em><em>But you can sell with trade by doing !sellhouse (player name)</em></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left;\"><em><strong>Thank you for your attention!</strong></em></p>', 'House Auction!', 0, 1, 1697008634, 0, 1697174307, '138.97.62.211', 0, 0),
(3, 3, 1697352383, 1, 0, 7, 1323211, 2, '<p style=\"text-align: center;\"><iframe src=\"//www.youtube.com/embed/pKSkLRAGqS4\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>', 'Hunt or mysteries?', 0, 1, 1697352383, 0, 1697491205, '138.97.62.211', 0, 0),
(4, 4, 1697731646, 1, 0, 0, 1323211, 2, '<pre style=\"text-align: center;\">Now we have live system!<br /><br />!cast. start the live without a password.<br /><br />!cast 123. start live with password.<br /><br />/name nick. changes the spectator\'s name.<br /><br />/spectators. show the number of spectators in the live.<br /><br /><br />In addition, premium accounts gain 5% more exp with open live, this does not apply to parties!</pre>', '', 0, 1, 1697731646, 0, 0, '138.97.62.211', 0, 0),
(5, 5, 1697731688, 1, 0, 1, 1323211, 2, '<pre style=\"text-align: center;\"><em><strong>Now we have live system!<br /></strong></em>To enter, just press enter without entering your account number and password<br /><br /></pre>\r\n<pre style=\"text-align: center;\"><strong>!cast</strong>. start the live without a password.<br /><br /><strong>!cast</strong> <strong>123</strong>. start live with password.<br /><br /><strong>/name nick</strong>. changes the spectator\'s name.<br /><br /><strong>/spectators</strong>. show the number of spectators in the live.<br /><br /><br />In addition, premium accounts gain 5% more exp with open live, this does not apply to party!</pre>', 'Live System.', 0, 1, 1697731688, 0, 1697814267, '138.97.62.211', 0, 0);
