INSERT INTO `myaac_pages` (`id`, `name`, `title`, `body`, `date`, `player_id`, `php`, `enable_tinymce`, `access`, `hidden`) VALUES
(0, 'downloads', 'Downloads', '<div style=\"text-align: center;\"> </div>\r\n<div style=\"text-align: center;\">\r\n<h2>DOWNLOAD</h2>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://i.imgur.com/Fz9lcys.png\" width=\"600\" height=\"400\" /></p>\r\n<h2><a title=\"Client New\" href=\"https://tibiacore.sytes.net/TibiaCore2.zip\">TibiaCore 7.4 for Windows</a></h2>\r\n<p> </p>\r\n<h2><a title=\"Client New\" href=\"https://drive.google.com/file/d/16u_rj7wwt5DYrreN2TJovDfs-V091uQ2/view?usp=drive_link\">TibiaCore for Mobile</a> (Disable)</h2>\r\n<h2> </h2>\r\n<h2><a title=\"Minimap\" href=\"https://tibiacore.sytes.net/minimap.zip\">Minimap</a></h2>\r\n<p><strong style=\"font-family: arial, sans-serif; font-size: 16px; background-color: #808080;\">Press the keyboard: Windows + R</strong></p>\r\n<p><img src=\"data:image/png;base64,\" alt=\"\" /></p>\r\n<p><strong>Unzip minimap.zip and open client.</strong></p>\r\n<p><img src=\"data:image/png;base64,\" alt=\"\" /></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #5a2800; font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: bold; font-stretch: normal; font-size: 16px; line-height: normal; font-family: arial; text-align: left;\">Requirements</span><br style=\"color: #5a2800; font-family: Verdana, Arial, \'Times New Roman\', sans-serif; font-size: 12px; text-align: left;\" /><strong style=\"color: #5a2800; font-family: Verdana, Arial, \'Times New Roman\', sans-serif; font-size: 12px; text-align: left;\">Minimum:</strong></p>\r\n<ul style=\"color: #5a2800; font-family: Verdana, Arial, \'Times New Roman\', sans-serif; font-size: 12px; text-align: left;\">\r\n<li>Processor: 1.5 GHz dualcore</li>\r\n<li>Memory: 1GB RAM</li>\r\n<li>Graphics: 128MB; OpenGL support</li>\r\n<li>Hard Drive: min. 150 MB</li>\r\n<li>Internet: 50 Kbs download, 25 Kbs upload</li>\r\n</ul>\r\n<p style=\"text-align: left;\"><strong style=\"color: #5a2800; font-family: Verdana, Arial, \'Times New Roman\', sans-serif; font-size: 12px; text-align: left;\">Recommended:</strong></p>\r\n<ul style=\"color: #5a2800; font-family: Verdana, Arial, \'Times New Roman\', sans-serif; font-size: 12px; text-align: left;\">\r\n<li style=\"text-align: left;\">Processor: 2.5 GHz dualcore or better</li>\r\n<li style=\"text-align: left;\">Memory: 4GB RAM</li>\r\n<li style=\"text-align: left;\">Graphics: 512MB; OpenGL support</li>\r\n<li style=\"text-align: left;\">Hard Drive: min. 150 MB</li>\r\n<li style=\"text-align: left;\">Internet: 200 Kbs download, 100 Kbs upload</li>\r\n</ul>\r\n<h4> </h4>\r\n</div>', 0, 1, 0, 1, 1, 0),
(1, 'Task', 'Task', '<h2 style=\"text-align: center;\"><span style=\"font-size: 16.38px;\">To get the tasks, talk to the <span style=\"color: #0000ff; background-color: #ffff00;\">Post Office Npcs</span> in any city!</span></h2>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 16.38px;\">To get the reward is \"<span style=\"color: #00ff00;\">reward</span>\" and </span><span style=\"font-size: 16.38px;\">cancel is \"<span style=\"color: #ff0000;\">cancel</span>\"</span></p>\r\n<table style=\"border-collapse: collapse; width: 92.0805%; height: 104px; margin-left: auto; margin-right: auto;\" border=\"1\">\r\n<tbody>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 32.4406%; height: 18px; text-align: center;\"><strong>Monsters</strong></td>\r\n<td style=\"width: 8.09746%; height: 18px; text-align: center;\"><strong>Task</strong></td>\r\n<td style=\"width: 47.4566%; height: 18px; text-align: center;\"><strong> Reward</strong></td>\r\n<td style=\"width: 18.7639%; height: 18px; text-align: center;\"><strong>Experience</strong></td>\r\n</tr>\r\n<tr style=\"height: 18px; text-align: center;\">\r\n<td style=\"width: 32.4406%; height: 18px;\">\r\n<p><a title=\"Amazon\" href=\"/?subtopic=creatures&creature=amazon\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/images/monsters/amazon.gif\" width=\"32\" height=\"32\" /></a></p>\r\n</td>\r\n<td style=\"width: 8.09746%; height: 18px; text-align: center;\">200</td>\r\n<td style=\"width: 47.4566%; height: 18px;\"> <img src=\"https://www.tibiawiki.com.br/images/f/f8/Platinum_Coin.gif\" alt=\"\" width=\"32\" height=\"32\" />x25 Platinum Coins</td>\r\n<td style=\"width: 18.7639%; height: 18px;\"> 5.000</td>\r\n</tr>\r\n<tr style=\"height: 64px;\">\r\n<td style=\"width: 32.4406%; height: 64px;\">\r\n<p style=\"text-align: center;\"><a title=\"Bug\" href=\"/?subtopic=creatures&creature=bug\"><img src=\"/images/monsters/bug.gif\" width=\"32\" height=\"32\" /></a></p>\r\n</td>\r\n<td style=\"w