(4, 'kazordoon_miner', 'Kazordoon Miner', '<p style=\"text-align: center;\"> </p>\r\n<h1 style=\"text-align: center;\"><strong>Kazordoon Miner</strong></h1>\r\n<hr />\r\n<h4 style=\"text-align: center;\">Required level: 0</h4>\r\n<h4 style=\"text-align: center;\"><strong>Recommended level: 20</strong></h4>\r\n<h4 style=\"text-align: center;\">Required Items: </h4>\r\n<p style=\"text-align: center;\">shovel, rope any health</p>\r\n<h4 style=\"text-align: center;\">Monsters to Face:</h4>\r\n<p style=\"text-align: center;\">minotaurs, archers and guards.</p>\r\n<h4 style=\"text-align: center;\">Reward:</h4>\r\n<p style=\"text-align: center;\">mining helmet and possibility to buy pickaxes and upgrade, make weapons and armor.</p>\r\n<hr />\r\n<p style=\"text-align: center;\"><strong>First visite Npc west from depot kazordoon, t</strong><strong>alk about a mission.</strong></p>\r\n<p style=\"text-align: center;\"><strong>He asks you to speak with Budrik, located in a mine to the west.</strong></p>\r\n<p style=\"text-align: center;\"><img src=\"https://i.imgur.com/WkVM3h8.png\" alt=\"\" width=\"514\" height=\"302\" /></p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\"><strong>Budrik asks for your help, and you\'ll have to face some minotaurs to the south west of the region.</strong></p>\r\n<p style=\"text-align: center;\"><img src=\"https://i.imgur.com/RVR9Acm.png\" alt=\"\" width=\"515\" height=\"303\" /></p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\"><strong>Get the helmet behind the door and go back to Budrik.</strong></p>\r\n<p style=\"text-align: center;\"><strong>After that go back to dwarf blacksmith.</strong></p>\r\n<p style=\"text-align: center;\"><strong><img src=\"https://i.imgur.com/o2TJLzs.png\" alt=\"\" width=\"559\" height=\"426\" /></strong></p>\r\n<p style=\"text-align: center;\"><strong>C</strong><strong>omplete the mission. then ask for a pickaxe.</strong></p>', 0, 1, 0, 1, 1, 0),
