/tibiacore.online/images/items/4495.gif\" width=\"32\" height=\"32\" /> x5 Copper Ores = 1 Copper Bar</strong> <strong><img src=\"https://tibiacore.online/images/items/4496.gif\" width=\"32\" height=\"32\" /></strong></p>\r\n<p style=\"text-align: center;\"><strong><img src=\"https://tibiacore.online/images/items/4497.gif\" width=\"32\" height=\"32\" /> x5 Iron Ores = 1 Iron Bar</strong> <strong><img src=\"https://tibiacore.online/images/items/4498.gif\" width=\"32\" height=\"32\" /></strong></p>\r\n<p style=\"text-align: center;\"><strong><img src=\"https://tibiacore.online/images/items/4499.gif\" width=\"32\" height=\"32\" /> x5 Gold Nugget = 1 Gold Bar</strong> <strong><img src=\"https://tibiacore.online/images/items/4444.gif\" width=\"32\" height=\"32\" /></strong></p>\r\n<p style=\"text-align: center;\"><strong><img src=\"https://tibiacore.online/images/items/4442.gif\" width=\"32\" height=\"32\" /> x5 Walfram Ore = 1 Walfram Bar</strong> <strong><img src=\"https://tibiacore.online/images/items/4443.gif\" width=\"32\" height=\"32\" /></strong></p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\"><strong>Getting the amount of 5 ores, click on the ore and on the table to make a bar.</strong></p>\r\n<p style=\"text-align: center;\"><strong><img src=\"https://i.imgur.com/u2Tv5Ij.gif\" width=\"398\" height=\"298\" /></strong></p>\r\n<p style=\"text-align: center;\"><strong>With the bars in the backpack, you can exchange the preferred item, talking to the npc Dwarf Blacksmith. </strong></p>\r\n<p style=\"text-align: center;\"><strong>For example: hi - plate armor - yes.</strong></p>', 0, 1, 0, 1, 1, 0),
(10, 'rules', 'Rules', '<table style=\"border-collapse: collapse; width: 100%; height: 522px; margin-left: auto; margin-right: auto;\" border=\"1\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 5.19308%; background-color: #9e5e3c;\">\r\n<h4 style=\"text-align: center;\"><strong> </strong></h4>\r\n</td>\r\n<td style=\"width: 94.807%; background-color: #9e5e3c;\">\r\n<h2 style=\"text-align: center;\"><span style=\"color: #ffffff;\"><strong>1. Names</strong></span><strong><br /></strong></h2>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 5.19308%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong>a)</strong></h4>\r\n</td>\r\n<td style=\"width: 94.807%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong> Names which contain insulting (e.g. \"Bastard\"), racist (e.g. \"Nigger\"), extremely right-wing (e.g. \"Hitler\"), sexist (e.g. \"Bitch\") or offensive (e.g. \"Copkiller\") language.</strong></h4>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 5.19308%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong>b)</strong></h4>\r\n</td>\r\n<td style=\"width: 94.807%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong> Names containing parts of sentences (e.g. \"Mike returns\"), nonsensical combinations of letters (e.g. \"Fgfshdsfg\") or invalid formattings (e.g. \"Thegreatknight\").</strong></h4>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 5.19308%; height: 18px; background-color: #9e5e3c;\"> </td>\r\n<td style=\"width: 94.807%; height: 18px; background-color: #9e5e3c;\">\r\n<h2 style=\"text-align: center;\"><span style=\"color: #ffffff;\"><strong>2. Cheating</strong></span></h2>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 5.19308%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong>a)</strong></h4>\r\n</td>\r\n<td style=\"width: 94.807%; height: 18px;\"><br /><strong style=\"text-align: center;\"> Exploiting obvious errors of the game (\"bugs\"), for instance to duplicate items. If you find an error you must report it to admintration immediately. If discovered in the investigation, it will be deleted immediately.</strong></td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 5.19308%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong>c) </strong></h4>\r\n</td>\r\n<td style=\"width: 94.807%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong>Manipulate the client program with bot or use additional software to play the game, ban 6 months ago 1 year.</strong></h4>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 5.19308%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong>d)</strong></h4>\r\n</td>\r\n<td style=\"width: 94.807%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong> Trying to steal other players\' account data (\"hacking\").</strong></h4>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 5.19308%; height: 18px; text-align: center;\"><strong style=\"text-align: center;\">e)</strong></td>\r\n<td style=\"width: 94.807%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong>Play on more than four accounts at the same time (\"multi-client\").</strong></h4>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 5.19308%; height: 18px; background-color: #9e5e3c;\"> </td>\r\n<td style=\"width: 94.807%; height: 18px; background-color: #9e5e3c;\">\r\n<h2 style=\"text-align: center;\"><span style=\"color: #ffffff;\"><strong>3. Gamemasters</strong></span></h2>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 5.19308%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong>a)</strong></h4>\r\n</td>\r\n<td style=\"width: 94.807%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong> Threatening a gamemaster because of his or her actions or position as a gamemaster.</strong></h4>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 5.19308%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong>b) </strong></h4>\r\n</td>\r\n<td style=\"width: 94.807%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong>Pretending to be a gamemaster or to have influence on the decisions of a gamemaster.</strong></h4>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 5.19308%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong>c) </strong></h4>\r\n</td>\r\n<td style=\"width: 94.807%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong>Intentionally giving wrong or misleading information to a gamemaster concerning his or her investigations or making false reports about rule violations.</strong></h4>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 5.19308%; height: 18px; text-align: center;\"><strong style=\"text-align: center;\">d) </strong></td>\r\n<td style=\"width: 94.807%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong>Insulting or creating false stories from gamemasters in relationships about players.</strong></h4>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 5.19308%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong>e)</strong></h4>\r\n</td>\r\n<td style=\"width: 94.807%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong>Provoking the administration in-game, such as creating a character nickname indirectly.</strong></h4>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 5.19308%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong>f)</strong></h4>\r\n</td>\r\n<td style=\"width: 94.807%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong> Verbally offending or cursing the community.</strong></h4>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 5.19308%; height: 18px; background-color: #9e5e3c;\"> </td>\r\n<td style=\"width: 94.807%; height: 18px; background-color: #9e5e3c;\">\r\n<h2 style=\"text-align: center;\"><span style=\"color: #ffffff;\"><strong>4. Player Killing</strong></span></h2>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 5.19308%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong>a) </strong></h4>\r\n</td>\r\n<td style=\"width: 94.807%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong>Players offline for too long, logging in just to kill other players or chasing low levels. will be severely punished or deleted.</strong></h4>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 5.19308%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong>b) </strong></h4>\r\n</td>\r\n<td style=\"width: 94.807%; height: 18px;\">\r\n<h4 style=\"text-align: center;\"><strong>High level players who kill new very low level players for no reason will be severely punished or deleted.</strong></h4>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"1\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 100%;\">\r\n<h4 style=\"text-align: center;\"><span style=\"color: #ff0000;\">A violation of the Tibia Rules may lead to temporary banishment of characters and accounts. In severe cases removal or modification of character skills, attributes and belongings, as well as the permanent removal of accounts without any compensation may be considered. The sanction is based on the seriousness of the rule violation and the previous record of the player. It is determined by the gamemaster imposing the banishment.</span></h4>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"1\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 100%;\">\r\n<h4 style=\"text-align: center;\"><strong>These rules may be changed at any time. All changes will be announced on the official website.</strong></h4>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h4 style=\"text-align: center;\"> </h4>', 0, 1, 0, 1, 1, 0);
